		counter = 0;
		phase_count = 0;
		phase_edit = 0;
	end
	
	//clock divider held in count
	always @(posedge clock) begin
		cnt = cnt + 1;
	end
	
	//responsible for shifting bits out
	always @(posedge cnt[0]) begin
		counter = counter + 1;
	end

