			//phase_end = (phase + 40) % 80;
		//mod took too many resources so the logic was broken down as below:
		if(newPhase >= 40) begin
			phase_end[phase_edit] = newPhase - 40;
		end
		else begin
			phase_end[phase_edit] = newPhase + 40;
		end
		//increment the phase to edit
		phase_edit = phase_edit + 1;
	end
	
